func lengthOfLongestSubstring(s string) int {
	var csc []byte
	var ml int
	for i := 0; i < len(s); i++ {
		j := 0
		for j < len(csc) {
			if s[i] == csc[j] {
				break
			}
			j++
		}
		if j < len(csc) {
			cl := len(csc)
			if cl > ml {
				ml = cl
			}
			csc = csc[j+1:]

		}
		csc = append(csc, s[i])
	}
	if len(csc) > ml {
		ml = len(csc)
	}
	return ml
}

